function readCookie(key) {
    var valCookie = "";
    var find = key + "=";
    if (document.cookie.length > 0) {
        pos = document.cookie.indexOf(find);
        if (pos != -1) {
            pos += find.length;
            fin = document.cookie.indexOf(";", pos);
            if (fin == -1) fin = document.cookie.length;
            valCookie = unescape(document.cookie.substring(pos, fin));
        }
    }
    return valCookie;
}

function writeCookie(key, value, min) {
    var expired = "";
    if (min != null) {
        expired = new Date((new Date()).getTime() + min * 60000);
        expired = "; expires=" + expired.toGMTString();
    }
    write = key + "=" + escape(value) + expired;
    document.cookie = write;
}

function decrypt(key, text, _iv) {
	var decrypted = CryptoJS.AES.decrypt(text, key,
               {
                   keySize: 128 / 8,
                   iv: _iv,
                   mode: CryptoJS.mode.CBC,
                   padding: CryptoJS.pad.Pkcs7
               });
	var subStringText = decrypted.toString().substring(32, decrypted.length);
	return CryptoJS.enc.Hex.parse(subStringText).toString(CryptoJS.enc.Utf8);
}
